‚†Ä
When done correctly you should feel these exercises working muscles on and around your shoulder blades üëçüèº.
‚†Ä
Exercise 1: Sidelying External Rotation
‚Ä¢Place something under your arm like a small towel roll
‚Ä¢With your elbow bent to 90 deg, pull shoulder blade into your opposite back pocket
‚Ä¢Lift your wrist towards the ceiling, slowly lower it back to your stomach then release shoulder blade
‚Ä¢Do this slowly and controlled. Start with 3x8-10 reps and work your way up to 3x20. When you can do that easily then you can add light weight
‚†Ä
Exercise 2: Sidelying Flexion
‚Ä¢Start with your arm resting on your side
‚Ä¢Move your arm forward to about shoulder height keeping it as level as you can (try not to let it go up toward the ceiling or down toward the floor)
‚Ä¢Do this slowly and controlled. Start with 3x8-10 reps and work your way up to 3x20. When you can do that easily you can add light weight
‚†Ä
Exercise 3: Wall Walk
‚Ä¢Stand with your forearms on the wall, stagger your stance to help reduce stress on your low back
‚Ä¢Keeping your wrists and elbows in line with your shoulders, walk your arms up the wall
‚Ä¢Do this 2-3 sets for 10 reps
*The most common mistake I see here is the elbows outside the wrists, this makes the exercise much easier and defeats the purpose of the muscles we are trying to strengthen here*
‚†Ä
‚†Ä
‚†Ä
