Meet Greg-- Greg came to IDPT after having his prostate removed due to prostate cancer. 

Read below to see what he has to say about his experience.

"Like many men faced with prostate cancer, I chose surgery over radiation as my preferred treatment. I knew ahead of time that after surgery I might have some incontinence. That‚Äôs because a guy‚Äôs prostate puts extra pressure against the urethra, which helps control his ‚Äúpee urge,‚Äù but prostate cancer surgery removes the prostate altogether. 

After the surgery, when I discussed this with my urologist who performed the surgery, he told me that occasional leakage is my ‚Äúnew normal‚Äù and I would just have to learn to live with it. Well, that wasn‚Äôt good enough for me. Just because I got treated for prostate cancer didn‚Äôt mean that life as I knew it had to be over.  It just meant that I needed to adjust, somehow.

My urologist told me that strengthening my Kegel muscles would help, and everything I read said the same thing. But somehow it wasn‚Äôt quite enough. One day I found myself running to the bathroom when all I did was stand up. I started thinking, hey, women grow up without a prostate and they figure out how to handle it. What was I not doing correctly?

Then I saw an ad for Inner Dynamics. The ad said they could help guys like me who had their prostate removed and still had lingering incontinence issues. I figured I had nothing to lose, so I checked them out. I must say, I was quite impressed with their knowledge of human anatomy. Little did I know that my Kegels can only go so far, and that the trick is to build up all those other little pelvic floor-area muscles that I didn‚Äôt even know were there." 

