‚Å£‚Å†
You have it and it tastes beautiful. ‚Å£‚Å†
‚Å£‚Å†
Guess what‚Ä¶‚Å£‚Å†
‚Å£‚Å†
You‚Äôve just reinforced your behaviour.‚Å£‚Å†
‚Å£‚Å†
This means that the next time that pizza comes out, you know how it‚Äôs going to taste and you‚Äôll get a dopamine hit.‚Å£‚Å†
‚Å£‚Å†
Dopamine is a neurotransmitter that‚Äôs linked to pleasure and usually blamed for addiction.‚Å£‚Å†
‚Å£‚Å†
So how do you stop the cravings? ‚Å£‚Å†
‚Å£‚Å†
As shown above, our mouths start watering at the sign of pizza when it‚Äôs around. ‚Å£‚Å†
‚Å£‚Å†
But it‚Äôs also been shown that when the pizza isn‚Äôt around, we don‚Äôt just start salivating. ‚Å£‚Å†
‚Å£‚Å†
Since cravings are driven by food-related sensory cues such as the sight and smell of tempting foods, the most straightforward way to beat them is to avoid exposing yourself to those cues.‚Å£‚Å†
‚Å£‚Å†
